import React from 'react';
import { Button, Text, View } from 'react-native';
import { Style } from '../core/Style';
import ThermalPrinter from 'react-native-thermal-printer';

const PrinterBluetoothComponent: React.FC = React.memo(() => {
  const [result, setResult] = React.useState<string>('');
  const text1 =
    '<img>data:image/png;base64,</img>';
  const text =
    "[C]<u><font size='big'>" +
    'Test success !' +
    '</font></u>\n' +
    '[L] \n' +
    '[L] \n';

  const testPrint = async () => {
    const start = new Date().getTime();
    try {
      setResult('');
      const btList = await ThermalPrinter.getBluetoothDeviceList();
      await ThermalPrinter.printBluetooth({
        macAddress: btList[0].macAddress,
        payload: text,
        printerWidthMM: 80,
        printerNbrCharactersPerLine: 32,
      });
      await ThermalPrinter.printBluetooth({
        macAddress: btList[0].macAddress,
        payload: text1,
        printerWidthMM: 80,
        printerNbrCharactersPerLine: 32,
      });
      setResult(
        'Success ! in ' + (new Date().getTime() - start) + ' milliseconds'
      );
    } catch (e) {
      setResult(
        'Failed ! in ' + (new Date().getTime() - start) + ' milliseconds'
      );
    }
  };

  return (
    <View>
      <Text style={Style.h1}>PrinterBluetoothComponent</Text>
      <Text>TODO</Text>
      <Button onPress={testPrint} title="Test print" />
      <Text style={Style.mt15}>Result: {result}</Text>
    </View>
  );
});
export default PrinterBluetoothComponent;
